import React from 'react'
import stars from '../libs/star'

const Article = (props) => {
    const { article } = props;
    return(
        <>
            <div>
                <div>Rate({stars(article.rating)})</div>
                <b>{article.title} / {article.date}</b>
                <div>{article.content}</div>
                <div>{article.author}</div>
            </div>
        </>
    )
}

export default Article;
